import './App.css';
import Day8 from './components/Day8/Day8';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Hw from './components/HW/Hw';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route index element={<Day8/>}>
          <Route path='/hw' element={<Hw/>}/>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
